[Form]
public class TMSCarrier extends FormRun
{
    LogisticsEntityPostalAddressFormHandler     postalAddressForm;
    LogisticsLocationRecId                      postalAddressLocation;
}

    public void init()
    {
        super();

        postalAddressForm = LogisticsEntityPostalAddressFormHandler::newParameters(tmsCarrier_ds, logisticsEntityPostalAddressView_ds);

		// When the LogisticsBasic confkey is on, but the warehouse and transportation modules are disabled, it is not necessary to show
		// the shipping carrier address tab. Turning off WHSandTMS while allowing for LogisticsBasic is only intended for users that whant 
		// to use a minimal set of the shipping carrier feature.
        if (isConfigurationkeyEnabled(configurationKeyNum(LogisticsBasic)) && !isConfigurationkeyEnabled(configurationKeyNum(WHSandTMS)))
        {
            address.visible(false);
        }

        this.setShippingLabelRequestTypeVisibility();
    }

/// <summary>
/// Updates the availability of the rating profile action buttons that are dependent on the record context.
/// </summary>
/// <remarks>
/// Since the tmsRatingProfile data source is delay joined to the tmsCarrier, the carrier
/// value can temporarily be different on the tmsRatingProfile when the user is in the process
/// of switching between carriers.  In this instance the controls should be disabled.
/// </remarks>
public void setRatingProfileActionAvailability()
{
    boolean isCarrier;

    // check if we are creating a new carrier or switching between carrier records.
    isCarrier = (tmsCarrier.RecId && tmsRatingProfile.CarrierCode == tmsCarrier.CarrierCode);

    tmsTransitTimeEngine.enabled(isCarrier && tmsRatingProfile.TransitTimeEngineCode != '');
    tmsRateMaster.enabled(isCarrier && tmsRatingProfile.RateMasterCode != '');
}

public int active()
{
    int ret;

    ret = super();

    element.setRatingProfileActionAvailability();

    if (ret)
    {
        LogisticsEntityPostalAddressView_ds.executeQuery();
    }

    return ret;
}

public void executeQuery()
{
    super();

    Args args = element.args();
    if (args && args.dataset() == tableNum(TMSCarrierService))
    {
        service.expand();
        this.positionToRecord(args.record());
    }
}

public int active()
{
    int ret;

    ret = super();

    element.setRatingProfileActionAvailability();

    tmsRatingProfile_ds.object(fieldNum(TMSRatingProfile, RateMasterCode)).enabled(tmsRatingProfile.RateEngineCode != '');

    return ret;
}

public void modified()
{
    super();

    if (tmsRatingProfile.RateEngineCode)
    {
        tmsRatingProfile_ds.object(fieldNum(TMSRatingProfile, RateMasterCode)).enabled(true);
    }
}

public void lookup(FormControl _formControl, str _filterStr)
{
    TMSRateBaseTypeCode rateBaseTypeCode = TMSRateEngine::find(TMSRatingProfile.RateEngineCode).RateBaseTypeCode;

    TMSRateMaster::lookupRateMaster(_formControl, rateBaseTypeCode);
}

public int active()
{
    int ret;

    ret = super();

    postalAddressForm.callerActive();
    postalAddressForm.callerUpdateButtons(newAddress, editAddress, deleteAddress, mapButton, deactivateAddress, logisticsLocationDefault, logisticsEntityPostalAddressView.IsPrimary);

    return ret;
}

public void executeQuery()
{
    LogisticsEntityPostalAddressView::updateQuery(this.query().dataSourceName(this.name()), tmsCarrier.RecId, LogisticsLocationEntityType::TMSCarrier);

    super();

    postalAddressForm.callerUpdateButtons(newAddress, editAddress, deleteAddress, mapButton, deactivateAddress, logisticsLocationDefault, logisticsEntityPostalAddressView.IsPrimary);
}
